  <script>
    const trigger = document.getElementById('all-nav-trigger');
    const menu = document.getElementById('all-nav-menu');
    const search = document.getElementById('all-nav-search');
    if (trigger && menu) {
      const closeMenu = () => {
        menu.classList.remove('open');
        trigger.setAttribute('aria-expanded', 'false');
      };
      trigger.addEventListener('click', () => {
        const isOpen = menu.classList.toggle('open');
        trigger.setAttribute('aria-expanded', String(isOpen));
        if (isOpen && search) search.focus();
      });
      menu.addEventListener('click', (e) => {
        const link = e.target.closest('a[data-target]');
        if (!link) return;
        e.preventDefault();
        const target = link.getAttribute('data-target');
        if (target) window.location.hash = target;
        closeMenu();
      });
      document.addEventListener('click', (e) => {
        if (e.target.closest('.all-nav')) return;
        closeMenu();
      });
      if (search) {
        search.addEventListener('input', () => {
          const term = search.value.toLowerCase();
          const items = menu.querySelectorAll('li');
          items.forEach((li) => {
            const text = li.textContent.toLowerCase();
            li.style.display = text.includes(term) ? '' : 'none';
          });
        });
      }
    }
  </script>
